import React from 'react';
import { Link } from 'react-router-dom';

export default function Navbar() {
    return (
        <div nav>
            <Link to="/">Home</Link>
            <Link to="/tshirts">T-Shirts</Link>
            <Link to="/tattoos">Tattoos</Link>
        </div>
    )
}
